function EnrollInCourse(n,t){var i=n.getAttribute("data-courseId"),r={courseId:i,userId:t};n=$(n);$.ajax({url:"api/Enrollment/EnrollInCourse",type:"POST",data:JSON.stringify(r),dataType:"json",contentType:"application/json",success:function(){n.css("visibility","hidden");var t=n.parent().siblings(".numberEnrolled").html();n.parent().siblings(".numberEnrolled").html(Number(t)+1);n.siblings(".dropCourse").css("visibility","visible");RefreshMyEnrollments()}})}function DropCourse(n,t){var i=n.getAttribute("data-courseId"),r={courseId:i,userId:t};n=$(n);$.ajax({url:"api/Enrollment/DropCourse",type:"POST",data:JSON.stringify(r),dataType:"json",contentType:"application/json",success:function(){n.css("visibility","hidden");var t=n.parent().siblings(".numberEnrolled").html();n.parent().siblings(".numberEnrolled").html(Number(t)-1);n.siblings(".enrollInCourse").css("visibility","visible");RefreshMyEnrollments()}})}